Classify the following email into one of the categories: "respond", "notify", "ignore". Use the following criteria:

- "respond": Emails that ask questions, request feedback, or imply a call to action. Look for phrases like "please reply", "action needed", or "question".
- "notify": Emails that share information, updates, or announcements without requiring a response. Keywords might include "inform", "announce", "update".
- "ignore": Emails that are informal, non-urgent, or do not require immediate action. This could include unsolicited suggestions or marketing pitches.

