{"identifier": "elon_email:d0150502", "prompt_str": "<TO_OPTIMIZE kind="User">
Classify the following email into one of the categories: "respond", "notify", "ignore" using both keyword cues and contextual understanding. 

- "respond": Emails that include explicit questions, requests, or implied calls to action, such as invitations for discussions or collaboration. Look for phrases like "please reply", "action needed", "question", or contextual cues suggesting engagement is desired, like "let's discuss" or "interested in your thoughts".

- "notify": Emails that share information, updates, or announcements without requiring a response. This can include formal updates, achievements, or milestones. Keywords might include "inform", "announce", "update" but also consider the email's relevance or significance even without these words.

- "ignore": Emails that are informal, non-urgent, or do not require immediate action. This includes unsolicited suggestions, marketing pitches, or personal achievements that do not demand attention. Examples include phrases like "special offer", "advertisement", or informal language suggesting low priority.

